$(document).on("click",".selectUnchecked a",function(){
	var object = $(this);
	var mainPanel = object.closest(".panel")
	var mainTable = mainPanel.find("table");
	mainPanel.find(".deselectChecked").removeClass("hide");
	mainPanel.find(".selectUnchecked").addClass("hide");
	mainTable.find("tbody tr").each(function(){
		var trRow = $(this);
		trRow.find('td input[type=checkbox]').prop("checked",true);
	});
});

$(document).on("change",".selectAllCheckbox",function(){
	var object = $(this);
	var isChecked = object.prop("checked");
	console.log(isChecked);
	var mainPanel = object.closest(".panel")
	var mainTable = mainPanel.find("table");
	if(isChecked){
		mainTable.find("tbody tr").each(function(){
			var trRow = $(this);
			trRow.find('td input[type=checkbox]').prop("checked",true);
			$(".clearAllCheckbox").prop("checked",false);	
		});		
	}else{
		mainTable.find("tbody tr").each(function(){
			var trRow = $(this);
			trRow.find('td input[type=checkbox]').prop("checked",false);
		});	
		$(".clearAllCheckbox").prop("checked",true);	
	}	
});


$(document).on("change",".clearAllCheckbox",function(){
	var object = $(this);
	var isChecked = object.prop("checked");
	console.log(isChecked);
	var mainPanel = object.closest(".panel")
	var mainTable = mainPanel.find("table");
	if(isChecked){
		mainTable.find("tbody tr").each(function(){
			var trRow = $(this);
			trRow.find('td input[type=checkbox]').prop("checked",false);
		});	
		$(".selectAllCheckbox").prop("checked",false);	
	}	else{
		
	}
});


$(document).on("click",".deselectChecked a",function(){
	var object = $(this);
	var mainPanel = object.closest(".panel")
	var mainTable = mainPanel.find("table");
	mainPanel.find(".deselectChecked").addClass("hide");
	mainPanel.find(".selectUnchecked").removeClass("hide");
	mainTable.find("tbody tr").each(function(){
		var trRow = $(this);
		trRow.find('td input[type=checkbox]').prop("checked",false);
	});
});

function getBase64FromImageUrl(url) {
	var img = new Image();
	img.crossOrigin = "anonymous";
	img.onload = function () {
	    var canvas = document.createElement("canvas");
	    canvas.width =this.width;
	    canvas.height =this.height;
	    var ctx = canvas.getContext("2d");
	    ctx.drawImage(this, 0, 0);
	    var dataURL = canvas.toDataURL("image/png");
	    return dataURL.replace(/^data:image\/(png|jpg);base64,/, "");
	};
	img.src = url;
}

